import React from 'react'

function Boardgames(props) {
  return (
    <div>
      <h1>Boardgames from API</h1>
      {props.boardgames.map((boardgames) => {
        return (
            <div key={boardgames.id}>
                <h2>{boardgames.title}</h2>
                <p>{boardgames.description}</p>
                <p>{boardgames.maxPlayers}</p>
            </div>
        );
      })}
    </div>
  )
}

export default Boardgames;
